import React, {Component} from 'react'

const ProfileCard = (props) => {
  console.log(props);

  let handleCompnaies = () => {
    //make these logos
    return props.user.companies? props.user.companies.map(company => `${company.name} `) : "nope"
  }

  return(
    <div>
      <div className="profile-card" class="card">
      <ul>Name: {props.user.name} </ul>
      <ul>Car: {props.user.car} </ul>
      <ul>Experience: {props.user.experience} </ul>
      <ul>Rating: {props.user.rating} </ul>
      <ul>Companies: {handleCompnaies()} </ul>
      <ul>Base Locaion: {props.user.location}</ul>
      </div>
      Profile!
    </div>
  )
}


export default ProfileCard
